import { DashboardLayout } from "../layouts";
import { fabric } from "fabric";
import { useEffect, useRef, useState } from "react";
import { Box, Grid, Button, Typography, Alert, AlertTitle, Breadcrumbs } from "@mui/material";
import PhoneAndroidIcon from "@mui/icons-material/PhoneAndroid";
import StayPrimaryLandscapeIcon from "@mui/icons-material/StayPrimaryLandscape";
import StayPrimaryPortraitIcon from "@mui/icons-material/StayPrimaryPortrait";
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import { useCarnetStore } from '../../hooks';
import { ChipFields } from "../components";
import { width } from "@mui/system";
import { AppLink } from "../../components";

export const CarnetPage = () => {
  const fileInputRef = useRef();

  const canvasRef = useRef(null)

  const {
    startSavingCarnet,
    startLoadingCarnet,
    activeCarnet,
    fields: currentFields ,
    loading
  } = useCarnetStore();

  //** Extraer de algun lado */
  const fields = ["nombre", "cedula", "cargo"]; 
  const fieldsInUse = activeCarnet?.fields?.split(",") || []; 

  const [svg, setSvg] = useState({})
  const [renderedCarnet, setRenderedCarnet] = useState("");

  const handleExportSvg = () => {
    const { svgCode, json } = svg;

    console.log(svgCode);
    let fields = currentFields.toString();
    startSavingCarnet({ contentsvg: svgCode, contentjson: json, fields })
  }

  const svgRenderedCarnet = `data:image/svg+xml,<?xml version="1.0" encoding="UTF-8" standalone="no" ?>
  <!DOCTYPE svg PUBLIC "-//W3C//DTD SVG 1.1//EN" "http://www.w3.org/Graphics/SVG/1.1/DTD/svg11.dtd">
  <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" version="1.1" width="318" height="500" viewBox="0 0 318 500" xml:space="preserve">
  <desc>Created with Fabric.js 5.3.0</desc>
  <defs>
  </defs>
  <g transform="matrix(0.45 0 0 0.46 159 250)"  >
    <image style="stroke: none; stroke-width: 0; stroke-dasharray: none; stroke-linecap: butt; stroke-dashoffset: 0; stroke-linejoin: miter; stroke-miterlimit: 4; fill: rgb(0,0,0); fill-rule: nonzero; opacity: 1;"  xlink:href="data:image/png;base64," x="-355" y="-538" width="710" height="1076"></image>
  </g>
  <g transform="matrix(1 0 0 1 156 135)"  >
    <image style="stroke: none; stroke-width: 0; stroke-dasharray: none; stroke-linecap: butt; stroke-dashoffset: 0; stroke-linejoin: miter; stroke-miterlimit: 4; fill: rgb(0,0,0); fill-rule: nonzero; opacity: 1;"  xlink:href="data:image/jpeg;base64," x="-100" y="-100" width="200" height="200"></image>
  </g>
  <g transform="matrix(0.94 0 0 0.94 162.18 343.82)" style="" id="nombre"  >
      <text xml:space="preserve" font-family="Times New Roman" font-size="40" font-style="normal" font-weight="normal" style="stroke: none; stroke-width: 1; stroke-dasharray: none; stroke-linecap: butt; stroke-dashoffset: 0; stroke-linejoin: miter; stroke-miterlimit: 4; fill: rgb(245,245,245); fill-rule: nonzero; opacity: 1; white-space: pre;" ><tspan x="-61.09" y="12.57" >nombre</tspan></text>
  </g>
  <g transform="matrix(0.69 0 0 0.69 158.5 376)" style="" id="cedula"  >
      <text xml:space="preserve" font-family="Times New Roman" font-size="40" font-style="normal" font-weight="normal" style="stroke: none; stroke-width: 1; stroke-dasharray: none; stroke-linecap: butt; stroke-dashoffset: 0; stroke-linejoin: miter; stroke-miterlimit: 4; fill: rgb(0,0,0); fill-rule: nonzero; opacity: 1; white-space: pre;" ><tspan x="-52.19" y="12.57" >cedula</tspan></text>
  </g>
  <g transform="matrix(0.61 0 0 0.61 159.33 407.17)" style="" id="accion"  >
      <text xml:space="preserve" font-family="Times New Roman" font-size="40" font-style="normal" font-weight="normal" style="stroke: none; stroke-width: 1; stroke-dasharray: none; stroke-linecap: butt; stroke-dashoffset: 0; stroke-linejoin: miter; stroke-miterlimit: 4; fill: rgb(0,0,0); fill-rule: nonzero; opacity: 1; white-space: pre;" ><tspan x="-52.19" y="12.57" >accion</tspan></text>
  </g>
  </svg>`;

  useEffect(() => {
    startLoadingCarnet();
  }, [])
  

  useEffect(() => {
    var $ = function (id) {
      return document.getElementById(id);
    };
  
    /**
     * @param {texts} Array 
     */
    function addText(texts = []) {
      let textsInstances = texts.map(text => new fabric.Text(text, { top: 100, id: text }));
      textsInstances.forEach(textInstance => {
        return textInstance.on('mousedown', function(options) {  
          console.log('Hiciste clic en el objeto de texto', options);
          activeText = options.target.id;
          // Aquí puedes realizar acciones adicionales al hacer clic en el objeto
        });
      })
  
      canvas.add(...textsInstances);
    }

    function removeText(texts = []) {

      const textObjects = texts.map(text => {
        var objects = canvas.getObjects();
  
      // Filtrar los objetos y encontrar el objeto por su identificador
        var myText = objects.find(function(object) {
          return object.id === text;
        });

        canvas.remove(myText);
      });


      canvas.renderAll();
    }
  
    function changeText(option, canvas, value = '') {
  
      if(activeText === '') {
        console.log('no hay nada seleccionado')
        return; 
      }
  
      const obj = {
        'bold': {'fontWeight': 'bold'},
        'italic': {'fontStyle': 'italic'},
        'underline': {'underline': true},
        'fontSelector': {'fontFamily': value},
        'fontColor': {'fill': value}
      }
  
      // newText = canvas.getItemById(activeText);
  
      // Obtener todos los objetos del lienzo
      var objects = canvas.getObjects();
  
      // Filtrar los objetos y encontrar el objeto por su identificador
      var myText = objects.find(function(object) {
        return object.id === activeText;
      });
  
      const prop = obj[option] || {}
  
      console.log(myText)
  
      myText.set(prop);  
      canvas.renderAll();
    }
  
    function setCanvasImage(img) {
      canvas.setBackgroundImage(img, canvas.renderAll.bind(canvas), {
        scaleX: canvas.width / img.width,
        scaleY: canvas.height / img.height,
      });
    }

    function toggleField(field) {
      console.log(field)
      const elem = document.getElementById(field)
      if(!elem) return;
      console.log(elem)

      elem.addEventListener("click", function() {
        if([...this.classList].includes("chip-active")) {
          removeText([elem.textContent], canvas);
          this.classList.remove('chip-active');
        } else {
          addText([elem.textContent])
          this.classList.add('chip-active'); 
        }
      })
    }
  
    let activeText = '';
  
    var canvas = new fabric.Canvas(canvasRef.current);
    fabric.Object.prototype.transparentCorners = false;

    if(activeCarnet.id) {

      // ! Codigo para cargar en el canvas un SVG

      // fabric.loadSVGFromString(activeCarnet.content, (objects, options) => {
      //   const svgObject = fabric.util.groupSVGElements(objects, options);
  
      //   // svgObject.ungroup();
  
      //   svgObject.getObjects().forEach((obj) => {
      //     obj.set('selectable', true);
      //   });
  
      //   canvas.add(...svgObject.getObjects());
      //   canvas.renderAll();
      // });

      canvas.loadFromJSON(activeCarnet.contentjson);

      const objects = canvas.getObjects();
      const textObjects = objects.filter(obj => obj.type === 'text');

      textObjects.forEach((obj) => {
        if (obj.type === 'text') { 
          obj.set('id', obj.text);
        }
      });

      textObjects.forEach(textInstance => {
        return textInstance.on('mousedown', function(options) {
          activeText = options.target.id;
        });
      })

    } else {
      // TODO: DEBEN SER EXTRAIDOS DE LA BASE DE DATOS
      // const texts = addText(["nombre", "cedula", "accion"]);
  
      // let rect = new fabric.Rect({
      //   left: 100,    // Posición izquierda del rectángulo
      //   top: 100,     // Posición superior del rectángulo
      //   width: 100,   // Ancho del rectángulo
      //   height: 100,  // Altura del rectángulo
      //   fill: '#ddd'  // Color de relleno del rectángulo
      // });
  
      // // Crear un nuevo texto
      // let text = new fabric.Text('foto', {
      //   fontSize: 20,                      // Tamaño de fuente del texto
      //   fill: 'black',                     // Color de relleno del texto
      //   left: rect.left + rect.width / 2,  // Posición horizontal centrada
      //   top: rect.top + rect.height / 2,   // Posición vertical centrada
      //   originX: 'center',                 // Origen X centrado
      //   originY: 'center'                  // Origen Y centrado
      // });

      // let group = new fabric.Group([rect, text], {
      //   left: rect.left,
      //   top: rect.top
      // });
      // canvas.add(group);
      fabric.Image.fromURL('https://neocarnets.neoaplicaciones.com/carnets/iconos/default.png', function(img) {
        // Configurar propiedades de la imagen
        img.set({
          left: 100,
          top: 100,
          width: 200,
          height: 200
        });

        // Añadir la imagen al lienzo
        canvas.add(img);
      });
    }

    let addBackgroundbtn = document.getElementById("addBackgroundbtn");
    // let toSvgBtn = document.getElementById("toSvgBtn");
  
    document.getElementById("subirFondo").addEventListener("change", function (e) {
      var file = e.target.files[0];
      var reader = new FileReader();
      reader.onload = function (f) {
        var data = f.target.result;
        fabric.Image.fromURL(data, function (img) {
          setCanvasImage(img)
        });
      };
      reader.readAsDataURL(file);
    });
  
    const textOptions = {
      bold: document.querySelector('#bold'),
      italic: document.querySelector('#italic'),
      underline: document.querySelector('#underline'),
    }
  
    for (let [key, value] of Object.entries(textOptions)) {
      value.addEventListener('click', () => changeText(key, canvas))
    }

    fields.forEach(field => toggleField(field));
    
    // * Cambiar la fuente
    document.querySelector('#fontSelector')
      .addEventListener('change', () => {
        changeText("fontSelector", canvas, document.querySelector('#fontSelector').value)
      }
    );

    // * Cambiar el color
    document.querySelector('#fontColor')
      .addEventListener('change', () => {
        changeText("fontColor", canvas, document.querySelector('#fontColor').value)
      }
    );

    // * Exportar el carnet
    toSvgBtn.addEventListener("click", () => {
      // setSvg(canvas.toSVG());
      setSvg({
        svgCode: canvas.toSVG(),
        json: JSON.stringify(canvas)
      })
    })

    document.querySelector('#previsualise')
      .addEventListener("click", () => {
        
        let renderedCarnet = "data:image/svg+xml," + canvas.toSVG();

        const cambiar = {
          accion: 12345,
          nombre: "John Doe",
          cedula: "12345678",
        };
        
        const fields = ["accion", "nombre", "cedula"];

        fields.forEach((field) => {
          const regex = new RegExp(field, "g");
          renderedCarnet = renderedCarnet.replace(regex, cambiar[field]);
        });

        console.log(renderedCarnet);

        setRenderedCarnet( renderedCarnet );
      }
    );

    /** *Cambiar fondo template */
    document.querySelectorAll(".carnetTemplates").forEach(el => el.addEventListener('click', function(e) {
      let imgInstance = new fabric.Image(this, {});
  
      setCanvasImage(imgInstance);
    }))
   
    
  }, [])
  const properties = { margin: 1 };

  return (
    <DashboardLayout properties={properties}>
      <AppLink path="/dashboard/persons">
        <Button><ArrowBackIcon /> Volver</Button>
      </AppLink>
      <Grid container sx={{ height: 'calc(100vh - 10vh)'}}>

        <Grid item md={9}>
          <button id="bold"><b>N</b></button>
          <button id="italic"><i>I</i></button>
          <button id="underline"><u>U</u></button>
          &nbsp;
          Fuente: 
          &nbsp;
          <select id="fontSelector">
            <option value="Arial">Arial</option>
            <option value="Helvetica">Helvetica</option>
            <option value="Times New Roman">Times New Roman</option>
            <option value="Courier New">Courier New</option>
            <option value="Verdana">Verdana</option>
            <option value="Georgia">Georgia</option>
            <option value="Impact">Impact</option>
            <option value="Comic Sans MS">Comic Sans MS</option>
          </select>
          &nbsp;
          Color:
          &nbsp;
          <input type="color" id="fontColor"/>
          <Box
            sx={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "center",
              backgroundColor: "#ddd",
              mx: 2,
            }}
          >
            
            <Box
              sx={{
                height: "500px",
                width: "318px",
                backgroundColor: "#ccc",
                borderRadius: "20px",
              }}
            >
              <canvas id="design" ref={canvasRef} width="318" height="500"></canvas>
            </Box>
          </Box>
        </Grid>
        <Grid item md={3}>
          <input
            type="file"
            name="subirFondo"
            id="subirFondo"
            style={{ display: "none" }}
            ref={fileInputRef}
          />
          <Typography>Sugerencia de fondos: </Typography>
          <Box
            sx={{
              display: "flex",
              mb: 2,
            }}
          >
            {imageTemplates.map((img) => (
              <img src={img} key={img} width="65" height="95" alt="image" className="carnetTemplates pointer"/>
            ))}
          </Box>

          <Box
            sx={{mb: 1}}
          >
            { 
            
            fields.map((field) => (
              <ChipFields field={field} active={ fieldsInUse.includes(field) } />
            ))
            
            }
          </Box>
          
          <Button
            id="addBackgroundbtn"
            onClick={() => {
              fileInputRef.current.click();
            }}
            variant="outlined"
            fullWidth
            sx={{ mb: 1 }}
          >
            Agregar fondo personalizado
          </Button>

          <a href="/w/dashboard/carnets#render">
            <Button id="previsualise" variant="outlined" fullWidth sx={{mb: 1}}>
                  Previsualizar
            </Button>
          </a>

          <Button id="toSvgBtn" variant="outlined" fullWidth onClick={handleExportSvg} disabled={loading}>
            Guardar
          </Button>

        </Grid>
      </Grid>

      <a href="/w/dashboard/carnets#editor" style={{ textDecoration: "none", color: "gray"}}>
        <Button>
          <ArrowBackIcon />
          &nbsp;
            Volver al editor
        </Button>
      </a>

      <Box id="render" sx={{ display:"flex", alignItems: "start", justifyContent: "center"}}>
        <img src={ renderedCarnet } alt="Rendered carnet"/>
      </Box>
    </DashboardLayout>
  );
};

const imageTemplates = [
  "https://neocarnets.neoaplicaciones.com/assets/bussinessTemplates/fvb.png",
  "https://neocarnets.neoaplicaciones.com/assets/bussinessTemplates/asturiano.png",
];
